import React from "react";
import { Grid, Paper } from "@material-ui/core";

function Login() {
  return (
    <div>
      <Grid container alignItems="center" style={{ height: "100%" }}>
        <Grid item xs={12}>
          <Paper elevation={4} style={{ margin: "10rem 20rem 20rem 20rem" }}>
            <Grid container alignItems="center" justify="center">
              <h1>Sign in</h1>
              <Snackbar
                open={this.state.open}
                // onClose={this.handleClose}
                TransitionComponent={this.state.Transition}
                // ContentProps={{
                //   "aria-describedby": "message-id"
                // }}
                // message={<span id="message-id">{this.state.flash}</span>}
              >
                <SnackbarContent
                  onClose={this.handleClose}
                  message={
                    <span>
                      {this.state.error !== true ? (
                        <CheckCircleIcon className="icon verticalAlign" />
                      ) : (
                        <ErrorIcon className="icon verticalAlign" />
                      )}
                      <span className="verticalAlign">
                        {" "}
                        {this.state.flash}{" "}
                      </span>
                      <IconButton
                        key="close"
                        aria-label="close"
                        color="inherit"
                        onClick={this.handleClose}
                        className="icon verticalAlign"
                      >
                        <CloseIcon />
                      </IconButton>
                    </span>
                  }
                  style={
                    this.state.error !== true
                      ? { backgroundColor: green[600] }
                      : { backgroundColor: "red" }
                  }
                />
              </Snackbar>
              <form onSubmit={this.handleSubmit}>
                <TextField
                  type="email"
                  name="email"
                  label="email"
                  onChange={this.updateEmailField}
                />
                <br />
                <br />
                <TextField
                  type="password"
                  name="password"
                  label="password"
                  onChange={this.updatePassword}
                />
                <br />
                <br />
                <Link to={"/profile"} type="submit" value="Submit">
                  Submit
                </Link>
              </form>
              <br />
              <br />
              <div>
                <Link to={"/signup"}>Signup</Link>
              </div>
            </Grid>
          </Paper>
        </Grid>
      </Grid>
    </div>
  );
}

export default Login;
